import React, { useState } from "react";
import {
  Main,
  Fieldset,
  InputField,
  Button,
  InsetText,
  Link,
} from "govuk-react";

function LoginForm() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");

  const submitFormHandler = (e) => {
    e.preventDefault();
  };

  return (
    <div>
      <Main>
        <form onSubmit={submitFormHandler}>
          <Fieldset>
            <Fieldset.Legend size="LARGE">Login</Fieldset.Legend>
            <InputField
              onChange={(e) => setEmail(e.target.value)}
              padding={3}
              input={{
                name: "loginemail",
                value: { email },
                type: "email",
              }}
            >
              Email address
            </InputField>
            <InputField
              onChange={(e) => setPassword(e.target.value)}
              padding={3}
              input={{
                name: "loginpw",
                value: { password },
                type: "password",
              }}
            >
              Password
            </InputField>
            <Button type="submit" margin={3}>
              Continue
            </Button>
          </Fieldset>
        </form>

        <br />
        <InsetText margin={3}>
          New patient? Register&nbsp;
          <Link href="#">here</Link>
        </InsetText>
        <br />
      </Main>
    </div>
  );
}

export default LoginForm;
